import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import { Navbar, Nav, Container, Card, Button } from 'react-bootstrap';  // Sin Jumbotron
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';

import Slide from './Slide';
import Galeria from './Galeria';
import Contacto from './Contacto';

export default function Menu() {
  return (
    <Router>
      <div>
        <Navbar bg="dark" variant="dark" expand="lg" sticky="top">
          <Container>
            <Navbar.Brand as={Link} to="/">SUNSUCA</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="ml-auto">
                <Nav.Link as={Link} to="/">Home</Nav.Link>
                <Nav.Link as={Link} to="/gallery">Gallery</Nav.Link>
                <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>

        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/gallery" component={Gallery} />
          <Route path="/contact" component={Contact} />
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div>
      <Slide />
    </div>
  );
}

function Gallery() {
  return (
    <div>
      <Container fluid className="bg-primary text-light py-5">
        <h1 className="display-3 font-weight-bold">Gallery</h1>
        <p className="lead">Explore our collection of images related to the agricultural sector.</p>
      </Container>
      <Container>
        <Galeria />
      </Container>
    </div>
  );
}

function Contact() {
  return (
    <div>
      <Container fluid className="bg-primary text-light py-5">
        <h1 className="display-3 font-weight-bold">Contact Us</h1>
        <p className="lead">Get in touch with our team for more information.</p>
      </Container>
      <Container>
        <Contacto />
      </Container>
    </div>
  );
}
